description.text:
Open the .scad file with OpenSCAD (available for almost every operating system!).  
You should be able to edit and compile the following variables:  
<code >effectorHeight = 10;  

// Size of Base Effector  
bodyDiameter = 60;  
bodyHeight   = effectorHeight;  
bodyDiaphram = 30;  

// Sizing of Arms  
armLength = 35;  
armWidth  = 40;  
armHeight = effectorHeight;  
armNub    = 6;  </code>
